from django.core.management.base import BaseCommand
from django.db import transaction

from apps.portal.models import Gender, OrganizationalHierarchy, Entity, Military, Enjoyer

fake = Faker()

class Command(BaseCommand):
    help = 'Populates the database with initial data.'

    def handle(self, *args, **options):
        self.stdout.write(self.style.SUCCESS('Starting to populate the database...'))
        
        # Proteção contra execução em produção
        if not settings.DEBUG:
            self.stdout.write(self.style.ERROR('This command can only be run in DEBUG mode.'))
            return
        
        with transaction.atomic():
            self.create_genders()
            self.stdout.write(self.style.SUCCESS('Genders populated successfully.'))
    
        with transaction.atomic():
            self.create_organizational_hierarchies()
            self.stdout.write(self.style.SUCCESS('Organizational hierarchies populated successfully.'))
        
        with transaction.atomic():
            self.create_entities()
            self.stdout.write(self.style.SUCCESS('Entities populated successfully.'))
        
        with transaction.atomic():
            self.create_military_and_enjoyers()
            self.stdout.write(self.style.SUCCESS('Military personnel and enjoyers populated successfully.'))

    def create_genders(self):
        genders = [
            {"name": "POLÍCIA MILITAR DA PARAÍBA", "description": "Categoria de entidades pertencentes a Polícia Militar da Paraíba"},
            {"name": "INTELIGÊNCIA", "description": "Categoria de entidades de Inteligência"},
            {"name": "ÓRGÃOS VINCULADOS", "description": "Categoria de entidades de Órgãos Vinculados"},
            {"name": "ÓRGÃOS NÃO VINCULADOS", "description": "Categoria de entidades de Órgãos Não Vinculados"},
            {"name": "CORPO DE BOMBEIROS MILITAR DA PARAÍBA", "description": "Categoria de entidades pertencentes ao Corpo de Bombeiros Militar da Paraíba"}
        ]
        for gender in genders:
            Gender.objects.get_or_create(
                name=gender['name'],
                defaults={
                    'description': gender['description'],
                    'uuid_portal': uuid.uuid4(),  # Generate a new UUID for each gender
                    'active': True
                }
            )

