    def create_military_and_enjoyers(self):
        entities = list(Entity.objects.all())
        starting_register = 100000
        used_emails = set(Enjoyer.objects.values_list('email', flat=True))
        used_cpf = set(Military.objects.values_list('cpf', flat=True))
        
        ranks = ["CEL", "TC", "MAJ", "CAP", "1º TEN", "2º TEN", "ASP", "ST", "1º SGT", "2º SGT", "3º SGT", "CB", "SD"]

        for entity in entities:
            for _ in range(5):  # Assume you want to create 5 militaries per entity
                
                cpf = ''.join([str(random.randint(0, 9)) for _ in range(11)])
                while cpf in used_cpf:
                    cpf = ''.join([str(random.randint(0, 9)) for _ in range(11)])
                used_cpf.add(cpf)
                
                email = fake.email()
                while email in used_emails:
                    email = fake.email()
                used_emails.add(email)

                rank = random.choice(ranks)

                first_name = fake.first_name().upper()
                last_name = fake.last_name().upper()
                birthdate = fake.date_of_birth(tzinfo=None, minimum_age=18, maximum_age=40)

                military = Military(
                    name=f"{first_name} {last_name}",
                    rank=rank,
                    nickname=fake.first_name().upper(),
                    admission_date=str(birthdate),
                    birthdate=str(birthdate),
                    register=str(starting_register).zfill(6),
                    activity_status="Active",
                    cpf=cpf,
                    genre=fake.random_element(elements=('M', 'F')),
                    email=email,
                    father=fake.name(),
                    mather=fake.name(),
                    place_of_birth=fake.city(),
                    marital_status=fake.random_element(elements=["Solteiro", "Casado", "Divorciado"]),
                    phone=fake.phone_number(),
                    address=fake.street_address(),
                    number=str(fake.building_number()),
                    complement=fake.secondary_address(),
                    district=fake.word(),
                    city=fake.city(),
                    state=fake.random_element(elements=["PB", "PE", "RJ", "SP"]),
                    zipcode=fake.postcode(),
                    military_identity=str(fake.random_int(min=100000, max=999999)),
                    cnh=str(fake.random_int(min=1000000, max=9999999)),
                    rg=str(fake.random_int(min=100000, max=999999)),
                    orgao_expeditor_rg="SSP",
                    entity=entity,
                    active=True 
                )
                military.save()
                starting_register += 1

                enjoyer = Enjoyer(
                    username=cpf,
                    first_name=rank,
                    last_name=last_name,
                    email=email,
                    full_name=f"{first_name} {last_name}",
                    birthdate=str(birthdate),
                    phone=fake.phone_number(),
                    entity=entity,
                    active=True 
                )
                enjoyer.save()
                
                user = User.objects.create_user(
                    username=cpf,
                    first_name=rank,
                    last_name=last_name,
                    email=email,
                    is_staff=True
                )
                military.user = user
                military.save()
                enjoyer.user = user
                enjoyer.save()
